import React from "react";
import styles from "./CartTable.module.css";

const CartTable = () => {
  const buttonSliderContent = [
    { img: "/images/image.jpeg", text: "Cart 1" },
    { img: "/images/image.jpeg", text: "Cart 2" },
    { img: "/images/image.jpeg", text: "Cart 3" },
    { img: "/images/image.jpeg", text: "Cart 4" },
    { img: "/images/image.jpeg", text: "Cart 5" },
    { img: "/images/image.jpeg", text: "Cart 6" },
    { img: "/images/image.jpeg", text: "Cart 7" },
    { img: "/images/image.jpeg", text: "Cart 8" },
    { img: "/images/image.jpeg", text: "Cart 9" },
    { img: "/images/image.jpeg", text: "Cart 10" },
  ];

  return (
    <div className={styles.cartTable}>
      {buttonSliderContent.map((item, index) => (
        <div
          key={index}
          className={`${styles.cart} ${
            index === 1 ? styles.doubleHeight : ""
          } ${
            index === 1 && window.innerWidth < 1023 ? styles.doubleWidth : ""
          }`}
        >
          <img src={item.img} alt="Slide" />
          <p>{item.text}</p>
        </div>
      ))}
    </div>
  );
};

export default CartTable;
